import { BrowserRouter , Routes } from 'react-router-dom';
import HomeScreen from './screens/HomeScreen';
function App() {
  return (
    <BrowserRouter>
    <div >
      <header >
       <a href="/">bitbasket</a>
      </header>
      <main>
        <Routes>
          <Routeste path="/" element={<HomeScreen />}/>

        </Routes>

      </main>
    </div>
    </BrowserRouter>
  );
}

export default App;
